en [[Special:Preferences|persönlichen Einstellungen]] verfügbar sind.\nDiese Übersicht bietet direkten Zugang zu den MediaWiki-Systemnachrichten, welche die Beschreibung sowie den Programmcode jedes Helferlein enthalten.\";'),('de','messages:gadgets-uses','s:7:\"Benutzt\";'),('de','messages:gadgets-required-rights','s:79:\"Erfordert die {{PLURAL:$2|folgende Berechtigung|folgenden Berechtigungen}}:\n\n$1\";'),('de','messages:gadgets-required-skins','s:102:\"Verfügbar bei {{PLURAL:$2|der folgenden Benutzeroberfläche|den folgenden Benutzeroberflächen}}: $1.\";'),('de','messages:gadgets-default','s:36:\"Für alle standardmäßig aktiviert.\";'),('de','messages:gadgets-export','s:6:\"Export\";'),('de','messages:gadgets-export-title','s:21:\"Export der Helferlein\";'),('de','messages:gadgets-not-found','s:41:\"Helferlein „$1“ wurde nicht gefunden.\";'),('de','messages:gadgets-export-text','s:580:\"Um das Helferlein $1 zu exportieren, klicke auf die Schaltfläche „{{int:gadgets-export-download}}“ und speichere die heruntergeladene Datei. Gehe sodann zur Spezialseite Spezial:Import auf dem für den Import vorgesehenen Wiki und lade die Datei hoch. Danach füge den folgenden Text der Seite MediaWiki:Gadgets-definition hinzu:\n<pre>$2</pre>\nDu musst über die notwendigen Berechtigungen auf dem für den Import vorgesehenen Wiki verfügen (einschließlich der Berechtigung MediaWiki-Systemnachrichten zu bearbeiten). Zudem muss der Import von Datei-Uploads aktiviert sein.\";'),('de','messages:gadgets-export-download','s:13:\"Herunterladen\";'),('de','messages:validator-desc','s:73:\"Ermöglicht anderen Softwareerweiterungen die Verarbeitung von Parametern\";'),('de','messages:validator-warning','s:11:\"Warnung: $1\";'),('de','messages:validator-error','s:10:\"Fehler: $1\";'),('de','messages:validator-fatal-error','s:32:\"\'\'\'Schwerwiegender Fehler:\'\'\' $1\";'),('de','messages:validator_error_parameters','s:91:\"{{PLURAL:$1|Der folgende Fehler wurde|Die folgenden Fehler wurden}} in der 