das Kontrollkästchen markiert werden, um dadurch anzuzeigen, dass man sich diesbezüglich tatsächlich sicher ist.\";'),('de','messages:smw_smwadmin_docu','s:276:\"Diese Spezialseite bietet während Installation und Aktualisierung von <a href=\"http://semantic-mediawiki.org/wiki/Semantic_MediaWiki_–_Startseite\">Semantic MediaWiki</a> Unterstützung. Wichtige Daten sollten vor der Ausführung administrativer Funktionen gesichert werden.\";'),('de','messages:smw_smwadmin_db','s:41:\"Datenbankinstallation und -aktualisierung\";'),('de','messages:smw_smwadmin_dbdocu','s:634:\"Semantic MediaWiki benötigt weitere Datentabellen in der MediaWiki-Datenbank, um die semantischen Daten speichern zu können.\nDie folgende Funktion gewährleistet, dass die Datenbank richtig eingerichtet ist.\nDie Datenbankänderungen, die in diesem Schritt durchgeführt werden, beeinträchtigen den Rest der MediaWiki-Datenbank nicht. Sie können, sofern dies gewünscht ist, leicht rückgängig gemacht werden.\nDiese Einrichtungsfunktion kann mehrere Male ausgeführt werden, ohne Schaden zu verursachen. Sie braucht allerdings nur einmal, während der Installation oder Aktualisierung von Semantic MediaWiki, durchgeführt werden.\";'),('de','messages:smw_smwadmin_permissionswarn','s:570:\"Sofern diese Aktion mit einem SQL-Fehler abbricht, könnte es sein, dass der Datenbankbenutzer, mit dem das Wiki auf die Datenbank zugreift (siehe die Datei LocalSettings.php), über keine ausreichenden Rechte verfügt.\nUm das Problem zu beheben, ist es notwendig, entweder dem Benutzer zusätzliche Rechte zur Erstellung und Löschung von Datentabellen einzuräumen, den Datenbankadministrator zeitweilig in die LocalSettings.php einzutragen, oder aber das Wartungsskript <tt>SMW_setup.php</tt> zu nutzen, das die Benutzerdaten aus der Datei AdminSettings.php einsetzt.\";'),('de','messages:smw_smwadmin_dbbutton','s:42:\"Tabellen initialisieren oder aktualisieren\";'),('de','messages:smw_smwadmin_announce','s:18:\"Wiki bekannt geben\";'),('de','messages:smw_smwadmin_announcedocu','s:579:\"Semantic MediaWiki bietet einen Webservice zur Bekanntgabe neuer semantischer Wikis.\nDieser Service wird genutzt, um eine Liste aller öffentlich zugänglichen Wikis zu erhalten, die Semantic MediaWiki verwenden. Er dient aber auch dazu, dem <a href=\"http://semantic-mediawiki.org/wiki/SMW_Project\">„Semantic MediaWiki“-Projekt</a> einen Überblick über typische Anwendungen von Semantic MediaWiki zu ermöglichen.\nSiehe hierzu die Website von Semantic MediaWiki für <a href=\"http://semantic-mediawiki.org/wiki/Registry\">weiterführende Informationen zu diesem Service</a>.\";'),('de','messages:smw_smwadmin_announcebutton','s:251:\"Bitte die folgende Schaltfläche anklicken, um dem Verzeichnisdienst die URL dieses Wikis hinzuzufügen.\nEs werden dabei nur öffentlich zugängliche Informationen gespeichert. Es werden keine Wikis aufgenommen, die nicht öffentlich zugänglich sind.\";'),('de','messages:smw_smwadmin_datarefresh','s:35:\"Datenreparatur oder -aktualisierung\";'),('de','messages:smw_smwadmin_datarefreshdocu','s:614:\"Es ist möglich alle Datenbanken von Semantic MediaWiki auf Basis des aktuellen Inhalts des Wikis wiederherzustellen.\nDies kann hilfreich sein, um eine fehlerhafte Datenbank zu erneuern oder um Daten zu aktualisieren, sofern bspw. aufgrund einer Softwareaktualisierung die Datenbankstruktur geändert wurde.\nDie Datenaktualisierung wird für jede Seite ausgeführt und daher einige Zeit in Anspruch nehmen.\nNachfolgend wird angezeigt, ob eine momentan Aktualisierung läuft bzw. ermöglicht es eine Aktualisierung zu starten oder zu stoppen (sofern diese Funktion nicht vom Websiteadministrator deaktiviert wurde).\";'),('de','messages:smw_smwadmin_datarefreshprogress','s:659:\"<strong>Eine Aktualisierung wird bereits durchgeführt.</strong>\nEine Aktualisierung geht normalerweise nur langsam voran, da die Daten lediglich in kleinen Schritten erneuert werden, und zwar jedes Mal, wenn ein Benutzer auf das Wiki zugreift.\nUm diese Aktualisierung schneller zu Ende zu führen, kann man das MediaWiki-Wartungsskript <tt>runJobs.php</tt> einsetzen. Mit dem Parameter <tt>--maxjobs 1000</tt> beschränkt man dabei die Anzahl der Aktualisierungsschritte, die in einem Durchgang durchgeführt werden, um Probleme bei der Nutzung des hierfür erforderlichen Arbeitsspeichers zu vermeiden.\nGeschätzter Fortschritt der laufenden Aktualisierung:\";'),('de','messages:smw_smwadmin_datarefreshbutton','s:27:\"Datenaktualisierung starten\";'),('de','messages:smw_smwadmin_datarefreshstop','s:33:\"Diese Datenaktualisierung beenden\";'),('de','messages:smw_smwadmin_datarefreshstopconfirm','s:23:\"Ja, ich bin mir sicher.\";'),('de','messages:smw_smwadmin_support','s:23:\"Unterstützung erhalten\";'),('de','messages:smw_smwadmin_supportdocu','s:63:\"Verschiedene Hinweise helfen vielleicht im Fall eines Problems:\";'),('de','messages:smw_smwadmin_installfile','s:185:\"Sofern es Probleme mit der Installation gibt, könnte die Datei <a href=\"http://svn.wikimedia.org/svnroot/mediawiki/trunk/extensions/SemanticMediaWiki/INSTALL\">INSTALL</a> weiterhelfen.\";'),('de','messages:smw_smwadmin_smwhomepage','s:195:\"Die komplette Nutzerdokumentation von Semantic MediaWiki ist auf <b><a href=\"http://semantic-mediawiki.org/wiki/Semantic_MediaWiki_%E2%80%93_Startseite\">semantic-mediawiki.org</a></b> verfügbar.\";'),('de','messages:smw_smwadmin_mediazilla','s:91:\"Fehler können bei <a href=\"https://bugzilla.wikimedia.org/\">Bugzilla</a> berichtet werden.\";'),('de','messages:smw_smwadmin_questions','s:214:\"Im Fall weiterer Fragen oder Anregungen kann man sich an den Diskussionen im <a href=\"http://sourceforge.net/mailarchive/forum.php?forum_name=semediawiki-user\">„Semantic MediaWiki“-Benutzerforum</a> beteiligen.\";'),('de','messages:smw_adminlinks_datastructure','s:13:\"Datenstruktur\";'),('de','messages:smw_adminlinks_displayingdata','s:14:\"Daten anzeigen\";'),('de','messages:smw_adminlinks_inlinequerieshelp','s:31:\"