's:18:\"Datenbank gesperrt\";'),('de','messages:enterlockreason','s:118:\"Bitte gib einen Grund ein, warum die Datenbank gesperrt werden soll und eine Abschätzung über die Dauer der Sperrung\";'),('de','messages:readonlytext','s:139:\"Die Datenbank ist vorübergehend für Neueinträge und Änderungen gesperrt. Bitte versuche es später noch einmal.\n\nGrund der Sperrung: $1\";'),('de','messages:missing-article','s:302:\"Der Text von „$1“ $2 wurde nicht in der Datenbank gefunden.\n\nDie Seite ist möglicherweise gelöscht oder verschoben worden.\n\nFalls dies nicht  zutrifft, hast du eventuell einen Fehler in der Software gefunden. Bitte melde dies einem [[Special:ListUsers/sysop|Administrator]] unter Nennung der URL.\";'),('de','messages:missingarticle-rev','s:20:\"(Versionsnummer: $1)\";'),('de','messages:missingarticle-diff','s:40:\"(Unterschied zwischen Versionen: $1, $2)\";'),('de','messages:readonly_lag','s:171:\"Die Datenbank wurde automatisch für Schreibzugriffe gesperrt, damit sich die verteilten Datenbankserver (slaves) mit dem Hauptdatenbankserver (master) abgleichen können.\";'),('de','messages:internalerror','s:15:\"Interner Fehler\";'),('de','messages:internalerror_info','s:19:\"Interner Fehler: $1\";'),('de','messages:fileappenderrorread','s:63:\"„$1“ konnte während des Hinzufügens nicht gelesen werden.\";'),('de','messages:fileappenderror','s:44:\"Konnte „$1“ nicht an „$2“ anhängen.\";'),('de','messages:filecopyerror','s:61:\"Die Datei „$1“ konnte nicht nach „$2“ kopiert werden.\";'),('de','messages:filerenameerror','s:63:\"Die Datei „$1“ konnte nicht nach „$2“ umbenannt werden.\";'),('de','messages:filedeleteerror','s:49:\"Die Datei „$1“ konnte nicht gelöscht werden.\";'),('de','messages:directorycreateerror','s:54:\"Das Verzeichnis „$1“ konnte nicht angelegt werden.\";'),('de','messages:filenotfound','s:40:\"Die Datei „$1“ wurde nicht gefunden.\";'),('de','messages:fileexistserror','s:90:\"In die Datei „$1“ konnte nicht geschrieben werden, da die Datei ber