sse verschickt.\n\nBevor eine E-Mail von anderen Benutzern über die E-Mail-Funktion empfangen werden kann, muss die Adresse und ihre tatsächliche Zugehörigkeit zu diesem Benutzerkonto erst bestätigt werden. Bitte befolge die Hinweise in der Bestätigungs-E-Mail.\";'),('de','messages:throttled-mailpassword','s:246:\"Es wurde innerhalb der letzten {{PLURAL:$1|Stunde|$1 Stunden}} bereits ein neues Passwort angefordert. Um einen Missbrauch der Funktion zu verhindern, kann nur {{PLURAL:$1|einmal pro Stunde|alle $1 Stunden}} ein neues Passwort angefordert werden.\";'),('de','messages:mailerror','s:33:\"Fehler beim Senden der E-Mail: $1\";'),('de','messages:acct_creation_throttle_hit','s:302:\"Besucher dieses Wikis, die deine IP-Adresse verwenden, haben innerhalb des letzten Tages {{PLURAL:$1|1 Benutzerkonto|$1 Benutzerkonten}} erstellt, was die maximal erlaubte Anzahl in dieser Zeitperiode ist.\n\nBesucher, die diese IP-Adresse verwenden, können momentan keine Benutzerkonten mehr erstellen.\";'),('de','messages:emailauthenticated','s:54:\"Deine E-Mail-Adresse wurde am $2 um $3 Uhr bestätigt.\";'),('de','messages:emailnotauthenticated','s:139:\"Deine E-Mail-Adresse ist noch nicht bestätigt. Die folgenden E-Mail-Funktionen stehen erst nach erfolgreicher Bestätigung zur Verfügung.\";'),('de','messages:noemailprefs','s:106:\"Gib eine E-Mail-Adresse in den Einstellungen an, damit die nachfolgenden Funktionen zur Verfügung stehen.\";'),('de','messages:emailconfirmlink','s:46:\"E-Mail-Adresse bestätigen (authentifizieren).\";'),('de','messages:invalidemailaddress','s:179:\"Die E-Mail-Adresse wird nicht akzeptiert, weil sie ein ungültiges Format (eventuell ungültige Zeichen) zu haben scheint. Bitte gib eine korrekte Adresse ein oder leere das Feld.\";'),('de','messages:accountcreated','s:22:\"Benutzerkonto erstellt\";'),('de','messages:accountcreatedtext','s:40:\"Das Benutzerkonto $1 wurde eingerichtet.\";'),('de','messages:createaccount-title','s:49:\"Erstellung eines Benutzerkontos für {{SITENAME}}\";'),('de','messages:createaccount-text','s:288:\"Es wurde für dich ein Benutzerkonto „$2“ auf {{SITENAME}} ($4) erstellt. Das automatisch generierte Passwort für „$2“ ist „$3“. Du solltest dich nun anmelden und das Passwort ändern.\n\nFalls das Benutzerkonto irrtümlich angelegt wurde, kannst du diese Nachricht ignorieren.\";'),('de','messages:usernamehasherror','s:50:\"Benutzernamen dürfen kein Rautenzeichen enthalten\";'),('de','messages:login-throttled','s:84:\"Du hast zu oft versucht, dich anzumelden.\nBitte warte, bevor du es erneut probierst.\";'),('de','messages:login-abort-generic','s:53:\"Deine Anmeldung war nicht erfolgreich – Abgebrochen\";'),('de','messages:loginlanguagelabel','s:11:\"Sprache: $1\";'),('de','messages:suspicious-userlogout','s:122:\"Deine Abmeldeanfrage wurde verweigert, da sie vermutlich von einem defekten Browser oder einem Cache-Proxy gesendet wurde.\";'),('de','messages:php-mail-error-unknown','s:50:\"Unbekannter Fehler mit der Funktion mail() von PHP\";'),('de','messages:resetpass','s:16:\"Passwort ändern\";'),('de','messages:resetpass_announce','s:122:\"Anmeldung mit dem per E-Mail zugesandten Code. Um die Anmeldung abzuschließen, musst du jetzt ein neues Passwort wählen.\";'),('de','messages:resetpass_text','s:31:\"<!-- Ergänze den Text hier -->\";'),('de','messages:resetpass_header','s:16:\"Passwort ändern\";'),('de','messages:oldpassword','s:15:\"Altes Passwort:\";'),('de','messages:newpassword','s:15:\"Neues Passwort:\";'),('de','messages:retypenew','s:25:\"Neues Passwort (nochmal):\";'),('de','messages:resetpass_submit','s:34:\"Passwort übermitteln und anmelden\";'),('de','messages:resetpass_success','s:69:\"Dein Passwort wurde erfolgreich geändert. Es folgt die Anmeldung …\";'),('de','messages:resetpass_forbidden','s:41:\"Das Passwort kann nicht geändert werden.\";'),('de','messages:resetpass-no-info','s:62:\"Du musst dich anmelden, um auf diese Seite direkt zuzugreifen.\";'),('de','messages:resetpass-submit-loggedin','s:16:\"Passwort ändern\";'),('de','messages:resetpass-submit-cancel','s:9:\"Abbrechen\";'),('de','messages:resetpass-wrong-oldpass','s:163:\"Ungültiges temporäres oder aktuelles Passwort.\nMöglicherweise hast du dein Passwort bereits erfolgreich geändert oder ein neues temporäres Passwort beantragt.\";'),('de','messages:resetpass-temp-password','s:21:\"Temporäres Passwort:\";'),('de','messages:passwordreset','s:22:\"Passwort zurücksetzen\";'),('de','messages:passwordreset-text','s:126:\"Bitte dieses Formular ausfüllen, um per E-Mail eine Erinnerung zu den Anmeldeinformationen deines Benutzerkontos zu erhalten.\";'),('de','messages:passwordreset-legend','s:22:\"Passwort zurücksetzen\";'),('de','messages:passwordreset-disabled','s:68:\"Das Zurücksetzen von Passwörtern wurde in diesem Wiki deaktiviert.\";'),('de','messages:passwordreset-pretext','s:48:\"{{PLURAL:$1||Gib eines der folgenden Daten ein}}\";'),('de','messages:passwordreset-username','s:13:\"Benutzername:\";'),('de','messages:passwordreset-domain','s:7:\"Domain:\";'),('de','messages:passwordreset-email','s:15:\"E-Mail-Adresse:\";'),('de','messages:passwordreset-emailtitle','s:43:\"Benutzerkontoinformationen auf {{SITENAME}}\";'),('de','messages:passwordreset-emailtext-ip','s:704:\"Jemand mit der IP-Adresse $1, wahrscheinlich du selbst, hat eine Erinnerung an deine Benutzerkonteninformationen für {{SITENAME}} angefordert ($4). {{PLURAL:$3|Das folgende Benutzerkonto ist|Die folgenden Benutzerkonten sind}} mit dieser E-Mail-Adresse verknüpft:\n\n$2\n\n{{PLURAL:$3|Dieses temporäre Passwort läuft|Diese temporären Passwörter laufen}} innerhalb von {{PLURAL:$5|einem Tag|$5 Tagen}} ab.\nDu solltest dich anmelden und ein neues Passwort vergeben. Falls jemand anderes diese Anfrage getätigt hat oder du dich wieder an dein ursprüngliches Passwort erinnern kannst und es nicht länger ändern möchtest, kannst du diese Nachricht ignorieren und weiterhin dein altes Passwort benutzen.\";'),('de','messages:passwordreset-emailtext-user','s:669:\"Benutzer $1 auf {{SITENAME}} hat eine Erinnerung an deine Benutzerkonteninformationen für {{SITENAME}} angefordert ($4). {{PLURAL:$3|Das folgende Benutzerkonto ist|Die folgenden Benutzerkonten sind}} mit dieser E-Mail-Adresse verknüpft:\n\n$2\n\n{{PLURAL:$3|Dieses temporäre Passwort läuft|Diese temporären Passwörter laufen}} innerhalb von {{PLURAL:$5|einem Tag|$5 Tagen}} ab. Du solltest dich anmelden und ein neues Passwort vergeben. Falls jemand anderes diese Anfrage getätigt hat oder du dich wieder an dein ursprüngliches Passwort erinnern kannst und es nicht ändern möchtest, kannst du diese Nachricht ignorieren und weiterhin dein altes Passwort benutzen.\";'),('de','messages:passwordreset-emailelement','s:41:\"Benutzername: $1\nTemporäres Passwort: $2\";'),('de','messages:passwordreset-emailsent','s:42:\"Eine Erinnerung wurde per E-Mail versandt.\";'),('de','messages:bold_sample','s:11:\"Fetter Text\";'),('de','messages:bold_tip','s:11:\"Fetter Text\";'),('de','messages:italic_sample','s:13:\"Kursiver Text\";'),('de','messages:italic_tip','s:13:\"Kursiver Text\";'),('de','messages:link_sample','s:9:\"Link-Text\";'),('de','messages:link_tip','s:13:\"Interner Link\";'),('de','messages:extlink_sample','s:32:\"http://www.example.com Link-Text\";'),('de','messages:extlink_tip','s:32:\"Externer Link (http:// beachten)\";'),('de','messages:headline_sample','s:20:\"Ebene-2-Überschrift\";'),('de','messages:headline_tip','s:20:\"Ebene-2-Überschrift\";'),('de','messages:nowiki_sample','s:34:\"Unformatierten Text hier einfügen\";'),('de','messages:nowiki_tip','s:19:\"Unformatierter Text\";'),('de','messages:image_sample','s:12:\"Beispiel.jpg\";'),('de','messages:image_tip','s:9:\"Dateilink\";'),('de','messages:media_sample','s:12:\"Beispiel.ogg\";'),('de','messages:media_tip','s:16:\"Mediendatei-Link\";'),('de','messages:sig_tip','s:30:\"Deine Signatur mit Zeitstempel\";'),('de','messages:hr_tip','s:37:\"Horizontale Linie (sparsam verwenden)\";'),('de','messages:summary','s:16:\"Zusammenfassung:\";'),('de','messages:subject','s:8:\"Betreff:\";'),('de','messages:minoredit','s:35:\"Nur Kleinigkeiten wurden verändert\";'),('de','messages:watchthis','s:22:\"Diese Seite beobachten\";'),('de','messages:savearticle','s:15:\"Seite speichern\";'),('de','messages:preview','s:8:\"Vorschau\";'),('de','messages:showpreview','s:15:\"Vorschau zeigen\";'),('de','messages:showlivepreview','s:18:\"Sofortige Vorschau\";'),('de','messages:showdiff','s:18:\"Änderungen zeigen\";'),('de','messages:anoneditwarning','s:189:\"Du bearbeitest diese Seite unangemeldet. Wenn du speicherst, wird deine aktuelle IP-Adresse in der Versionsgeschichte aufgezeichnet und ist damit unwiderruflich \'\'\'öffentlich\'\'\' einsehbar.\";'),('de','messages:anonpreviewwarning','s:107:\"\'\'Du bist nicht angemeldet. Beim Speichern wird deine IP-Adresse in der Versionsgeschichte aufgezeichnet.\'\'\";'),('de','messages:missingsummary','s:164:\"\'\'\'Hinweis:\'\'\' Du hast keine Zusammenfassung angegeben. Wenn du erneut auf „{{int:savearticle}}“ klickst, wird deine Änderung ohne Zusammenfassung übernommen.\";'),('de','messages:missingcommenttext','s:36:\"Dein Abschnitt enthält keinen Text.\";'),('de','messages:missingcommentheader','s:168:\"\'\'\'Achtung:\'\'\' Du hast kein Betreff/Überschrift eingegeben. Wenn du erneut auf „{{int:savearticle}}“ klickst, wird deine Bearbeitung ohne Überschrift gespeichert.\";'),('de','messages:summary-preview','s:35:\"Vorschau der Zusammenfassungszeile:\";'),('de','messages:subject-preview','s:35:\"Vorschau der Zusammenfassungszeile:\";'),('de','messages:blockedtitle','s:21:\"Benutzer ist gesperrt\";'),('de','messages:blockedtext','s:701:\"\'\'\'Dein Benutzername oder deine IP-Adresse wurde gesperrt.\'\'\'\n\nDie Sperrung wurde von $1 durchgeführt.\nAls Grund wurde \'\'$2\'\' angegeben.\n\n* Beginn der Sperre: $8\n* Ende der Sperre: $6\n* Sperre betrifft: $7\n\nDu kannst $1 oder einen der anderen [[{{MediaWiki:Grouppage-sysop}}|Administratoren]] kontaktieren, um über die Sperre zu diskutieren.\nDu kannst die „E-Mail an diesen Benutzer“-Funktion nicht nutzen, solange keine gültige E-Mail-Adresse in deinen [[Special:Preferences|Benutzerkonto-Einstellungen]] eingetragen ist, oder diese Funktion für dich gesperrt wurde.\nDeine aktuelle IP-Adresse ist $3, und die Sperr-ID ist $5.\nBitte füge alle Informationen jeder Anfrage hinzu, die du stellt.\";'),('de','messages:autoblockedtext','s:722:\"Deine IP-Adresse wurde automatisch gesperrt, da sie von einem anderen Benutzer genutzt wurde, der von $1 gesperrt wurde.\nAls Grund wurde angegeben:\n\n:\'\'$2\'\'\n\n* Beginn der Sperre: $8\n* Ende der Sperre: $6\n* Sperre betrifft: $7\n\nDu kannst $1 oder einen der anderen [[{{MediaWiki:Grouppage-sysop}}|Administratoren]] kontaktieren, um über die Sperre zu diskutieren.\n\nDu kannst die „E-Mail an diesen Benutzer“-Funktion nicht nutzen, solange keine gültige E-Mail-Adresse in deinen [[Special:Preferences|Benutzerkonto-Einstellungen]] eingetragen ist, oder diese Funktion für dich gesperrt wurde.\n\nDeine aktuelle IP-Adresse ist $3, und die Sperr-ID ist $5.\nBitte füge alle Informationen jeder Anfrage hinzu, die du stellt.\";'),('de','messages:blockednoreason','s:27:\"keine Begründung angegeben\";'),('de','messages:blockedoriginalsource','s:47:\"Der Quelltext von \'\'\'$1\'\'\' wird hier angezeigt:\";'),('de','messages:blockededitsource','s:51:\"Der Quelltext \'\'\'deiner Änderungen\'\'\' an \'\'\'$1\'\'\':\";'),('de','messages:whitelistedittitle','s:54:\"Zum Bearbeiten ist es erforderlich, angemeldet zu sein\";'),('de','messages:whitelistedittext','s:50:\"Du musst dich $1, um Seiten bearbeiten zu können.\";'),('de','messages:confirmedittext','s:180:\"Du musst deine E-Mail-Adresse erst bestätigen, bevor du Bearbeitungen durchführen kannst. Bitte ergänze und bestätige deine E-Mail in den [[Special:Preferences|Einstellungen]].\";'),('de','messages:nosuchsectiontitle','s:24:\"Abschnitt nicht gefunden\";'),('de','messages:nosuchsectiontext','s:154:\"Du hast versucht, einen Abschnitt zu bearbeiten, der nicht existiert.\nVermutlich wurde er verschoben oder gelöscht, nachdem du die Seite aufgerufen hast.\";'),('de','messages:loginreqtitle','s:22:\"Anmeldung erforderlich\";'),('de','messages:loginreqlink','s:8:\"anmelden\";'),('de','messages:loginreqpagetext','s:45:\"Du musst dich $1, um Seiten lesen zu können.\";'),('de','messages:accmailtitle','s:25:\"Passwort wurde verschickt\";'),('de','messages:accmailtext','s:220:\"Ein zufällig generiertes Passwort für [[User talk:$1|$1]] wurde an $2 versandt.\n\nDas Passwort für dieses neue Benutzerkonto kann auf der Spezialseite „[[Special:ChangePassword|Passwort ändern]]“ geändert werden.\";'),('de','messages:newarticle','s:5:\"(Neu)\";'),('de','messages:newarticletext','s:331:\"Du bist einem Link zu einer Seite gefolgt, die nicht vorhanden ist.\nUm diese Seite anzulegen, trage deinen Text in das untenstehende Bearbeitungsfeld ein (siehe die [[{{MediaWiki:Helppage}}|Hilfeseite]] für weitere Informationen).\nSofern du fälschlicherweise hier bist, klicke auf die Schaltfläche \'\'\'Zurück\'\'\' deines Browsers.\";'),('de','messages:anontalkpagetext','s:583:\"----\'\'Diese Seite dient dazu, einem nicht angemeldeten Benutzer Nachrichten zu hinterlassen. Es wird seine IP-Adresse zur Identifizierung verwendet. IP-Adressen können von mehreren Benutzern gemeinsam verwendet werden. Wenn du mit den Kommentaren auf dieser Seite nichts anfangen kannst, richten sie sich vermutlich an einen früheren Inhaber deiner IP-Adresse und du kannst sie ignorieren. Du kannst dir auch ein [[Special:UserLogin/signup|Benutzerkonto erstellen]] oder dich [[Special:UserLogin|anmelden]], um künftig Verwechslungen mit anderen anonymen Benutzern zu vermeiden.\'\'\";'),('de','messages:noarticletext','s:349:\"Diese Seite enthält momentan noch keinen Text.\nDu kannst sie <span class=\"plainlinks\">[{{fullurl:{{FULLPAGENAME}}|action=edit}} bearbeiten]</span>,\nihren Titel auf anderen Seiten [[Special:Search/{{PAGENAME}}|suchen]]\noder die zugehörigen <span class=\"plainlinks\">[{{fullurl:{{#special:Log}}|page={{FULLPAGENAMEE}}}} Logbücher betrachten]</span>.\";'),('de','messages:noarticletext-nopermission','s:258:\"Diese Seite enthält momentan noch keinen Text.\nDu kannst ihren Titel auf anderen Seiten [[Special:Search/{{PAGENAME}}|suchen]]\noder die zugehörigen <span class=\"plainlinks\">[{{fullurl:{{#special:Log}}|page={{FULLPAGENAMEE}}}} Logbücher betrachten].</span>\";'),('de','messages:userpage-userdoesnotexist','s:134:\"Das Benutzerkonto „<nowiki>$1</nowiki>“ ist nicht vorhanden. Bitte prüfe, ob du diese Seite wirklich erstellen/bearbeiten willst.\";'),('de','messages:userpage-userdoesnotexist-view','s:47:\"Das Benutzerkonto „$1“ ist nicht vorhanden.\";'),('de','messages:blocked-notice-logextract','s:158:\"{{GENDER:$1|Dieser Benutzer|Diese Benutzerin|Dieser Benutzer}} ist zurzeit gesperrt.\nZur Information folgt ein aktueller Auszug aus dem Benutzersperr-Logbuch:\";'),('de','messages:clearyourcache','s:662:\"\'\'\'Hinweis:\'\'\' Leere nach dem Speichern den Browser-Cache, um die Änderungen sehen zu können.\n* \'\'\'Firefox/Safari:\'\'\' \'\'Umschalttaste\'\' drücken und gleichzeitig \'\'Aktualisieren\'\' anklicken oder entweder \'\'Strg+F5\'\' oder \'\'Strg+R\'\' (\'\'⌘+R\'\' auf dem Mac) drücken\n* \'\'\'Google Chrome:\'\'\' \'\'Umschalttaste+Strg+R\'\' (\'\'⌘+Umschalttaste+R\'\' auf dem Mac) drücken\n* \'\'\'Internet Explorer:\'\'\' \'\'Strg+F5\'\' drücken oder \'\'Strg\'\' drücken und gleichzeitig \'\'Aktualisieren\'\' anklicken\n* \'\'\'Opera:\'\'\' \'\'Extras → Internetspuren löschen … → Individuelle Auswahl → Den kompletten Cache löschen\'\'\n* \'\'\'Konqueror:\'\'\' \'\'Aktualisieren\'\' anklicken oder \'\'F5\'\' drücken\";'),('de','messages:usercssyoucanpreview','s:104:\"\'\'\'Tipp:\'\'\' Benutze den „{{int:showpreview}}“-Button, um dein neues CSS vor dem Speichern zu testen.\";'),('de','messages:userjsyoucanpreview','s:111:\"\'\'\'Tipp:\'\'\' Benutze den „{{int:showpreview}}“-Button, um dein neues JavaScript vor dem Speichern zu testen.\";'),('de','messages:usercsspreview','s:112:\"\'\'\'Beachte, dass du nur eine Vorschau deines Benutzer-CSS betrachtest.\'\'\'\n\'\'\'Es wurde noch nicht gespeichert!\'\'\'\";'),('de','messages:userjspreview','s:119:\"\'\'\'Beachte, dass du nur eine Vorschau deines Benutzer-JavaScript betrachtest.\'\'\'\n\'\'\'Es wurde noch nicht gespeichert!\'\'\'\";'),('de','messages:sitecsspreview','s:103:\"\'\'\'Beachte, dass du nur eine Vorschau dieses CSS betrachtest.\'\'\'\n\'\'\'Es wurde noch nicht gespeichert!\'\'\'\";'),('de','messages:sitejspreview','s:110:\"\'\'\'Beachte, dass du nur eine Vorschau dieses JavaScript betrachtest.\'\'\'\n\'\'\'Es wurde noch nicht gespeichert!\'\'\'\";'),('de','messages:userinvalidcssjstitle','s:274:\"\'\'\'Achtung:\'\'\' Die Benutzeroberfläche „$1“ existiert nicht. Bedenke, dass benutzerspezifische .css- und .js-Seiten mit einem Kleinbuchstaben anfangen müssen, also beispielsweise \'\'{{ns:user}}:Mustermann/vector.css\'\' an Stelle von \'\'{{ns:user}}:Mustermann/Vector.css\'\'.\";'),('de','messages:updated','s:11:\"(Geändert)\";'),('de','messages:note','s:14:\"\'\'\'Hinweis:\'\'\'\";'),('de','messages:previewnote','s:73:\"\'\'\'Dies ist nur eine Vorschau, die Seite wurde noch nicht gespeichert!\'\'\'\";'),('de','messages:previewconflict','s:114:\"Diese Vorschau gibt den Inhalt des oberen Textfeldes wieder. So wird die Seite aussehen, wenn du jetzt speicherst.\";'),('de','messages:session_fail_preview','s:305:\"\'\'\'Deine Bearbeitung konnte nicht gespeichert werden, da Sitzungsdaten verloren gegangen sind.\nBitte versuche es erneut, indem du unter der folgenden Textvorschau nochmals auf „Seite speichern“ klickst.\nSollte das Problem bestehen bleiben, [[Special:UserLogout|melde dich ab]] und danach wieder an.\'\'\'\";'),('de','messages:session_fail_preview_html','s:450:\"\'\'\'Deine Bearbeitung konnte nicht gespeichert werden, da Sitzungsdaten verloren gegangen sind.\'\'\'\n\n\'\'Da in {{SITENAME}} das Speichern von reinem HTML aktiviert ist, wurde die Vorschau ausgeblendet, um JavaScript-Attacken vorzubeugen.\'\'\n\n\'\'\'Bitte versuche es erneut, indem du unter der folgenden Textvorschau nochmals auf „Seite speichern“ klickst.\nSollte das Problem bestehen bleiben, [[Special:UserLogout|melde dich ab]] und danach wieder an.\'\'\'\";'),('de','messages:token_suffix_mismatch','s:260:\"\'\'\'Deine Bearbeitung wurde zurückgewiesen, da dein Browser Zeichen im Bearbeiten-Token verstümmelt hat.\nEine Speicherung kann den Seiteninhalt zerstören. Dies geschieht bisweilen durch die Benutzung eines anonymen Proxy-Dienstes, der fehlerhaft arbeitet.\'\'\'\";'),('de','messages:edit_form_incomplete','s:164:\"\'\'\'Der Inhalt des Bearbeitungsformulars hat den Server nicht vollständig erreicht. Bitte prüfe deine Bearbeitungen auf Vollständigkeit und versuche es erneut.\'\'\'\";'),('de','messages:editing','s:23:\"Bearbeiten von „$1“\";'),('de','messages:editingsection','s:35:\"Bearbeiten von „$1“ (Abschnitt)\";'),('de','messages:editingcomment','s:41:\"Bearbeiten von „$1“ (Neuer Abschnitt)\";'),('de','messages:editconflict','s:24:\"Bearbeitungskonflikt: $1\";'),('de','messages:explainconflict','s:370:\"Jemand anders hat diese Seite geändert, nachdem du angefangen hast sie zu bearbeiten.\nDas obere Textfeld enthält den aktuellen Bearbeitungsstand der Seite.\nDas untere Textfeld enthält deine Änderungen.\nBitte füge deine Änderungen in das obere Textfeld ein.\n\'\'\'Nur\'\'\' der Inhalt des oberen Textfeldes wird gespeichert, wenn du auf „{{int:savearticle}}“ klickst.\";'),('de','messages:yourtext','s:9:\"Dein Text\";'),('de','messages:storedversion','s:20:\"Gespeicherte Version\";'),('de','messages:nonunicodebrowser','s:137:\"\'\'\'Achtung:\'\'\' Dein Browser kann Unicode-Zeichen nicht richtig verarbeiten. Bitte verwende einen anderen Browser um Seiten zu bearbeiten.\";'),('de','messages:editingold','s:133:\"\'\'\'Achtung: Du bearbeitest eine alte Version dieser Seite. Sofern du sie speicherst, werden alle neueren Versionen überschrieben.\'\'\'\";'),('de','messages:yourdiff','s:12:\"Unterschiede\";'),('de','messages:copyrightwarning','s:713:\"\'\'\'Bitte kopiere keine Webseiten, die nicht deine eigenen sind, benutze keine urheberrechtlich geschützten Werke ohne Erlaubnis des Urhebers!\'\'\'<br />\nDu gibst uns hiermit deine Zusage, dass du den Text \'\'\'selbst verfasst\'\'\' hast, dass der Text Allgemeingut \'\'\'(public domain)\'\'\' ist, oder dass der \'\'\'Urheber\'\'\' seine \'\'\'Zustimmung\'\'\' gegeben hat. Falls dieser Text bereits woanders veröffentlicht wurde, weise bitte auf der Diskussionsseite darauf hin.\n<i>Bitte beachte, dass alle {{SITENAME}}-Beiträge automatisch unter der „$2“ stehen (siehe $1 für Details). Falls du nicht möchtest, dass deine Arbeit hier von anderen verändert und verbreitet wird, dann drücke nicht auf „Seite speichern“.</i>\";'),('de','messages:copyrightwarning2','s:477:\"Bitte beachte, dass alle Beiträge zu {{SITENAME}} von anderen Mitwirkenden bearbeitet, geändert oder gelöscht werden können.\nReiche hier keine Texte ein, falls du nicht willst, dass diese ohne Einschränkung geändert werden können.\n\nDu bestätigst hiermit auch, dass du diese Texte selbst geschrieben hast oder diese von einer gemeinfreien Quelle kopiert hast\n(siehe $1 für weitere Details). \'\'\'ÜBERTRAGE OHNE GENEHMIGUNG KEINE URHEBERRECHTLICH GESCHÜTZTEN INHALTE!\'\'\'\";'),('de','messages:longpageerror','s:159:\"\'\'\'Fehler: Der Text, den du zu speichern versuchst, ist $1 KB groß. Dies ist größer als das erlaubte Maximum von $2 KB.\'\'\'\nEr kann nicht gespeichert werden.\";'),('de','messages:readonlywarning','s:285:\"\'\'\'Achtung: Die Datenbank wurde für Wartungsarbeiten gesperrt, so dass deine Änderungen derzeit nicht gespeichert werden können.\nSichere den Text bitte lokal auf deinem Computer und versuche zu einem späteren Zeitpunkt, die Änderu