ecial:FileList|Liste hochgeladener Dateien]], um vorhandene Dateien zu suchen und anzuzeigen. Siehe auch das [[Special:Log/upload|Datei-]] und [[Special:Log/delete|Lösch-Logbuch]].\n\nUm ein \'\'\'Bild\'\'\' in einer Seite zu verwenden, nutze einen Link in der folgenden Form:\n* \'\'\'<tt><nowiki>[[</nowiki>{{ns:file}}<nowiki>:Datei.jpg]]</nowiki></tt>\'\'\' – für ein Vollbild\n* \'\'\'<tt><nowiki>[[</nowiki>{{ns:file}}<nowiki>:Datei.png|200px|thumb|left|Alternativer Text]]</nowiki></tt>\'\'\' – für ein 200px breites Bild innerhalb einer Box, mit „Alternativer Text“ als Bildbeschreibung\n* \'\'\'<tt><nowiki>[[</nowiki>{{ns:media}}<nowiki>:Datei.ogg]]</nowiki></tt>\'\'\' – für einen direkten Link auf die Datei, ohne Darstellung der Datei\";'),('de','messages:upload-permitted','s:24:\"Erlaubte Dateitypen: $1.\";'),('de','messages:upload-preferred','s:26:\"Bevorzugte Dateitypen: $1.\";'),('de','messages:upload-prohibited','s:30:\"Nicht erlaubte Dateitypen: $1.\";'),('de','messages:uploadlog','s:13:\"Datei-Logbuch\";'),('de','messages:uploadlogpage','s:13:\"Datei-Logbuch\";');
INSERT INTO `l10n_cache` VALUES ('de','messages:uploadlogpagetext','s:138:\"Dies ist das Logbuch der hochgeladenen Dateien, siehe auch die [[Special:NewFiles|Galerie neuer Dateien]] für einen visuellen Überblick.\";'),('de','messages:filename','s:9:\"Dateiname\";'),('de','messages:filedesc','s:12:\"Beschreibung\";'),('de','messages:fileuploadsummary','s:20:\"Beschreibung/Quelle:\";'),('de','messages:filereuploadsummary','s:17:\"Dateiänderungen:\";'),('de','messages:filestatus','s:17:\"Copyright-Status:\";'),('de','messages:filesource','s:7:\"Quelle:\";'),('de','messages:uploadedfiles','s:20:\"Hochgeladene Dateien\";'),('de','messages:ignorewarning','s:38:\"Warnung ignorieren und Datei speichern\";'),('de','messages:ignorewarnings','s:20:\"Warnungen ignorieren\";'),('de','messages:minlength1','s:57:\"Dateinamen müssen mindestens einen Buchstaben lang sein.\";'),('de','messages:illegalfilename','s:135:\"Der Dateiname „$1“ enthält mindestens ein nicht erlaubtes Zeichen. Bitte benenne die Datei um und versuche sie erneut hochzuladen.\";'),('de','messages:badfilename','s:42:\"Der Dateiname wurde in „$1“ geändert.\";'),('de','messages:filetype-mime-mismatch','s:71:\"Dateierweiterung „.$1“ stimmt nicht mit dem MIME-Typ ($2) überein.\";'),('de','messages:filetype-badmime','s:67:\"Dateien mit dem MIME-Typ „$1“ dürfen nicht hochgeladen werden.\";'),('de','messages:filetype-bad-ie-mime','s:160:\"Diese Datei kann nicht hochgeladen werden, da der Internet Explorer sie als „$1“ erkennt, welcher ein nicht erlaubter potentiell gefährlicher Dateityp ist.\";'),('de','messages:filetype-unwanted-type','s:120:\"\'\'\'„.$1“\'\'\' ist ein unerwünschtes Dateiformat. Erlaubt {{PLURAL:$3|ist das Dateiformat|sind die Dateiformate}}: $2.\";'),('de','messages:filetype-banned-type','s:160:\"\'\'\'„.$1“\'\'\' {{PLURAL:$4|ist ein nicht erlaubter Dateityp|sind nicht erlaubte Dateitypen}}.\n{{PLURAL:$3|Erlaubter Dateityp ist|Erlaubte Dateitypen sind}} $2.\";'),('de','messages:filetype-missing','s:65:\"Die hochzuladende Datei hat keine Erweiterung (z. B. „.jpg“).\";'),('de','messages:empty-file','s:31:\"Die übertragene Datei ist leer\";'),('de','messages:file-too-large','s:35:\"Die übertragene Datei ist zu groß\";'),('de','messages:filename-tooshort','s:25:\"Der Dateiname ist zu kurz\";'),('de','messages:filetype-banned','s:31:\"Diese Dateiendung ist gesperrt.\";'),('de','messages:verification-error','s:50:\"Diese Datei hat die Dateiprüfung nicht bestanden.\";'),('de','messages:hookaborted','s:92:\"Der Versuch, die Änderung durchzuführen, ist aufgrund eines Extension-Hooks fehlgeschlagen\";'),('de','messages:illegal-filename','s:31:\"Der Dateiname ist nicht erlaubt\";'),('de','messages:overwrite','s:62:\"Das Überschreiben einer existierenden Datei ist nicht erlaubt\";'),('de','messages:unknown-error','s:39:\"Ein unbekannter Fehler ist aufgetreten.\";'),('de','messages:tmp-create-error','s:45:\"Temporäre Datei konnte nicht erstellt werden\";'),('de','messages:tmp-write-error','s:43:\"Fehler beim Schreiben der temporären Datei\";'),('de','messages:large-file','s:92:\"Die Dateigröße sollte nach Möglichkeit $1 nicht überschreiten. Diese Datei ist $2 groß.\";'),('de','messages:largefileserver','s:70:\"Die Datei ist größer als die vom Server eingestellte Maximalgröße.\";'),('de','messages:emptyfile','s:145:\"Die hochgeladene Datei ist leer. Der Grund kann ein Tippfehler im Dateinamen sein. Bitte kontrolliere, ob du die Datei wirklich hochladen willst.\";'),('de','messages:windows-nonascii-filename','s:70:\"Dieses Wiki unterstützt keine Dateinamen die Sonderzeichen enthalten.\";'),('de','messages:fileexists','s:153:\"Eine Datei mit diesem Namen existiert bereits.\nBitte prüfe \'\'\'<tt>[[:$1]]</tt>\'\'\', wenn du dir nicht sicher bist, ob du sie ändern willst.\n[[$1|thumb]]\";'),('de','messages:filepageexists','s:305:\"Eine Beschreibungsseite wurde bereits als \'\'\'<tt>[[:$1]]</tt>\'\'\' erstellt, es ist aber keine Datei mit diesem Namen vorhanden.\nDie eingegebene Beschreibung wird nicht auf die Beschreibungsseite übernommen.\nDie Beschreibungsseite musst du nach dem Hochladen der Datei noch manuell bearbeiten.\n[[$1|thumb]]\";'),('de','messages:fileexists-extension','s:206:\"Eine Datei mit ähnlichem Namen existiert bereits: [[$2|thumb]]\n* Name der hochzuladenden Datei: \'\'\'<tt>[[:$1]]</tt>\'\'\'\n* Name der vorhandenen Datei: \'\'\'<tt>[[:$2]]</tt>\'\'\'\nBitte wähle einen anderen Namen.\";'),('de','messages:fileexists-thumbnail-yes','s:265:\"Bei der Datei scheint es sich um ein Bild verringerter Größe \'\'(thumbnail)\'\' zu handeln. [[$1|thumb]]\nBitte prüfe die Datei \'\'\'<tt>[[:$1]]</tt>\'\'\'.\nWenn es sich um das Bild in Originalgröße handelt, so braucht kein separates Vorschaubild hochgeladen zu werden.\";'),('de','messages:file-thumbnail-no','s:222:\"Der Dateiname beginnt mit \'\'\'<tt>$1</tt>\'\'\'. Dies deutet auf ein Bild verringerter Größe \'\'(thumbnail)\'\' hin.\nBitte prüfe, ob du das Bild in voller Auflösung vorliegen hast und lade dieses unter dem Originalnamen hoch.\";'),('de','messages:fileexists-forbidden','s:187:\"Unter diesem Namen existiert bereits eine Datei und sie kann nicht überschrieben werden. Bitte gehe zurück und lade die Datei unter einem anderen Namen hoch. [[File:$1|thumb|center|$1]]\";'),('de','messages:fileexists-shared-forbidden','s:194:\"Unter diesem Namen existiert bereits eine Datei im zentralen Medienarchiv.\nWenn du diese Datei trotzdem hochladen möchtest, gehe bitte zurück und ändere den Namen.\n[[File:$1|thumb|center|$1]]\";'),('de','messages:file-exists-duplicate','s:74:\"Diese Datei ist ein Duplikat der folgenden {{PLURAL:$1|Datei|$1 Dateien}}:\";'),('de','messages:file-deleted-duplicate','s:121:\"Eine mit dieser identische Datei ([[:$1]]) wurde früher gelöscht. Sieh das Lösch-Logbuch ein, bevor du sie hochlädst.\";'),('de','messages:uploadwarning','s:7:\"Warnung\";'),('de','messages:uploadwarning-text','s:65:\"Bitte ändere unten die Dateibeschreibung und versuche es erneut.\";'),('de','messages:savefile','s:15:\"Datei speichern\";'),('de','messages:uploadedimage','s:21:\"lud „[[$1]]“ hoch\";'),('de','messages:overwroteimage','s:43:\"lud eine neue Version von „[[$1]]“ hoch\";'),('de','messages:uploaddisabled','s:21:\"Hochladen deaktiviert\";'),('de','messages:copyuploaddisabled','s:38:\"Das Hochladen von URLs ist deaktiviert\";'),('de','messages:uploadfromurl-queued','s:51:\"Dein Upload befindet sich nun in der Warteschlange.\";'),('de','messages:uploaddisabledtext','s:42:\"Das Hochladen von Dateien ist deaktiviert.\";'),('de','messages:php-uploaddisabledtext','s:112:\"Das Hochladen von Dateien wurde in PHP deaktiviert.\nBitte überprüfe die <code>file_uploads</code>-Einstellung.\";'),('de','messages:uploadscripted','s:108:\"Diese Datei enthält HTML- oder Scriptcode, der irrtümlich von einem Webbrowser ausgeführt werden könnte.\";'),('de','messages:uploadvirus','s:45:\"Diese Datei enthält einen Virus! Details: $1\";'),('de','messages:uploadjava','s:190:\"Dies ist eine ZIP-Datei, die ein CLASS-Datei von Java enthält.\nDas Hochladen von Java-Dateien ist nicht gestattet, da sie die Umgehung von Sicherheitseinschränkungen ermöglichen könnten.\";'),('de','messages:upload-source','s:10:\"Quelldatei\";'),('de','messages:sourcefilename','s:11:\"Quelldatei:\";'),('de','messages:sourceurl','s:10:\"Quell-URL:\";'),('de','messages:destfilename','s:9:\"Zielname:\";'),('de','messages:upload-maxfilesize','s:25:\"Maximale Dateigröße: $1\";'),('de','messages:upload-description','s:17:\"Dateibeschreibung\";'),('de','messages:upload-options','s:17:\"Hochlade-Optionen\";'),('de','messages:watchthisupload','s:22:\"Diese Datei beobachten\";'),('de','messages:filewasdeleted','s:176:\"Eine Datei mit diesem Namen wurde schon einmal hochgeladen und zwischenzeitlich wieder gelöscht. Bitte prüfe zuerst den Eintrag im $1, bevor du die Datei wirklich speicherst.\";'),('de','messages:filename-bad-prefix','s:220:\"Der Dateiname beginnt mit \'\'\'„$1“\'\'\'. Dies ist im allgemeinen der von einer Digitalkamera vorgegebene Dateiname und daher nicht sehr aussagekräftig.\nBitte gib der Datei einen Namen, der den Inhalt besser beschreibt.\";'),('de','messages:filename-prefix-blacklist','s:470:\" #<!-- Diese Zeile darf nicht verändert werden! --> <pre>\n#  Syntax:\n#   * Alles von einem #-Zeichen bis zum Ende der Zeile ist ein Kommentar.\n#   * Jede nicht-leere Zeile ist der Anfang eines typischen Dateinamens, der automatisch von einer Digitalkamera erzeugt wird.\nCIMG # Casio\nDSC_ # Nikon\nDSCF # Fuji\nDSCN # Nikon\nDUW # einige Mobiltelefone\nIMG # allgemein\nJD # Jenoptik\nMGP # Pentax\nPICT # verschiedene\n #</pre> <!-- Diese Zeile darf nicht verändert werden!-->\";'),('de','messages:upload-success-subj','s:23:\"Erfolgreich hochgeladen\";'),('de','messages:upload-success-msg','s:84:\"Das Hochladen von [$2] war erfolgreich. Sie ist hier verfügbar: [[:{{ns:file}}:$1]]\";'),('de','messages:upload-failure-subj','s:14:\"Hochladefehler\";'),('de','messages:upload-failure-msg','s:63:\"Es gab ein Problem mit deiner hochgeladenen Datei von [$2]:\n\n$1\";'),('de','messages:upload-warning-subj','s:15:\"Hochladewarnung\";'),('de','messages:upload-warning-msg','s:143:\"Es gab ein Problem beim Hochladen von [$2]. Bitte zum [[Special:Upload/stash/$1|Hochladeformular]] zurückkehren, um dieses Problem zu beheben.\";'),('de','messages:upload-proto-error','s:18:\"Falsches Protokoll\";'),('de','messages:upload-proto-error-text','s:72:\"Die URL muss mit <code>http://</code> oder <code>ftp://</code> beginnen.\";'),('de','messages:upload-file-error','s:15:\"Interner Fehler\";'),('de','messages:upload-file-error-text','s:167:\"Bei der Erstellung einer temporären Datei auf dem Server ist ein interner Fehler aufgetreten.\nBitte informiere einen [[Special:ListUsers/sysop|System-Administrator]].\";'),('de','messages:upload-misc-error','s:33:\"Unbekannter Fehler beim Hochladen\";'),('de','messages:upload-misc-error-text','s:233:\"Beim Hochladen ist ein unbekannter Fehler aufgetreten.\nPrüfe die URL auf Fehler, den Online-Status der Seite und versuche es erneut.\nWenn das Problem weiter besteht, informiere einen [[Special:ListUsers/sysop|System-Administrator]].\";'),('de','messages:upload-too-many-redirects','s:44:\"Die URL beinhaltete zu viele Weiterleitungen\";'),('de','messages:upload-unknown-size','s:18:\"Unbekannte Größe\";'),('de','messages:upload-http-error','s:35:\"Ein HTTP-Fehler ist aufgetreten: $1\";'),('de','messages:zip-file-open-error','s:75:\"Es ist ein Fehler beim Öffnen der Datei zur ZIP-Überprüfung aufgetreten.\";'),('de','messages:zip-wrong-format','s:41:\"Die angegebene Datei ist keine ZIP-Datei.\";'),('de','messages:zip-bad','s:171:\"Die Datei ist beschädigt oder eine aus anderweitigen Gründen nicht lesbare ZIP-Datei.\nSie kann daher keiner ordnungsgemäßen Sicherheitsüberprüfung unterzogen werden.\";'),('de','messages:zip-unsupported','s:188:\"Diese ZIP-Datei verfügt über Komprimierungseigenschaften, die nicht von MediaWiki unterstützt werden.\nSie kann daher keiner ordnungsgemäßen Sicherheitsüberprüfung unterzogen werden.\";'),('de','messages:uploadstash','s:31:\"Vorabspeicherung beim Hochladen\";'),('de','messages:uploadstash-summary','s:244:\"Diese Seite ermöglicht den Zugriff auf Dateien, die hochgeladen wurden, bzw. gerade hochgeladen werden, aber noch nicht auf dem Wiki publiziert wurden. Diese Dateien sind, der hochladende Benutzer ausgenommen, noch nicht öffentlich einsehbar.\";'),('de','messages:uploadstash-clear','s:41:\"Die vorab gespeicherten Dateien entfernen\";'),('de','messages:uploadstash-nofiles','s:52:\"Es sind keine vorab gespeicherten Dateien vorhanden.\";'),('de','messages:uploadstash-badtoken','s:135:\"Das Entfernen der vorab gespeicherten Dateien war erfolglos, vielleicht weil die Sitzungsdaten abgelaufen sind. Bitte erneut versuchen.\";'),('de','messages:uploadstash-errclear','s:60:\"Das Entfernen der vorab gespeicherten Dateien war erfolglos.\";'),('de','messages:uploadstash-ref