{MediaWiki:Helppage}}}}\";'),('de','messages:deletepage','s:14:\"Seite löschen\";'),('de','messages:confirm','s:11:\"Bestätigen\";'),('de','messages:excontent','s:20:\"Inhalt war: „$1“\";'),('de','messages:excontentauthor','s:75:\"Inhalt war: „$1“ (einziger Bearbeiter: [[Special:Contributions/$2|$2]])\";'),('de','messages:exbeforeblank','s:41:\"Inhalt vor dem Leeren der Seite: „$1“\";'),('de','messages:exblank','s:14:\"Seite war leer\";'),('de','messages:delete-confirm','s:21:\"Löschen von „$1“\";'),('de','messages:delete-legend','s:8:\"Löschen\";'),('de','messages:historywarning','s:130:\"\'\'\'Achtung:\'\'\' Die Seite, die du löschen möchtest, hat eine Versionsgeschichte mit ungefähr $1 {{PLURAL:$1|Version|Versionen}}:\";'),('de','messages:confirmdeletetext','s:237:\"Du bist dabei, eine Seite mit allen zugehörigen älteren Versionen zu löschen. Bitte bestätige dazu, dass du dir der Konsequenzen bewusst bist, und dass du in Übereinstimmung mit den [[{{MediaWiki:Policy-url}}|Richtlinien]] handelst.\";'),('de','messages:actioncomplete','s:14:\"Aktion beendet\";'),('de','messages:actionfailed','s:21:\"Aktion fehlgeschlagen\";'),('de','messages:deletedtext','s:78:\"„$1“ wurde gelöscht. Im $2 findest du eine Liste der letzten Löschungen.\";'),('de','messages:deletedarticle','s:21:\"löschte „[[$1]]“\";'),('de','messages:suppressedarticle','s:45:\"veränderte die Sichtbarkeit von „[[$1]]“\";'),('de','messages:dellogpage','s:14:\"Lösch-Logbuch\";'),('de','messages:dellogpagetext','s:56:\"Dies ist das Logbuch der gelöschten Seiten und Dateien.\";'),('de','messages:deletionlog','s:14:\"Lösch-Logbuch\";'),('de','messages:reverted','s:36:\"Auf eine alte Version zurückgesetzt\";'),('de','messages:deletecomment','s:6:\"Grund:\";'),('de','messages:deleteotherreason','s:27:\"Anderer/ergänzender Grund:\";'),('de','messages:deletereasonotherlist','s:13:\"Anderer Grund\";'),('de','messages:deletereason-dropdown','s:89:\"* Allgemeine Löschgründe\n** Wunsch des Autors\n** Urheberrechtsve