;'),('de','messages:lockfilenotwritable','s:138:\"Die Datenbank-Sperrdatei ist nicht beschreibbar. Zum Sperren oder Freigeben der Datenbank muss diese für den Webserver beschreibbar sein.\";'),('de','messages:databasenotlocked','s:33:\"Die Datenbank ist nicht gesperrt.\";'),('de','messages:lockedbyandtime','s:24:\"(von $1 am $2 um $3 Uhr)\";'),('de','messages:move-page','s:24:\"Verschieben von „$1“\";'),('de','messages:move-page-legend','s:17:\"Seite verschieben\";'),('de','messages:movepagetext','s:1037:\"Mit untenstehendem Formular kannst du eine Seite umbenennen, indem du sie mitsamt allen Versionen auf einen neuen Titel verschiebst.\nDer alte Titel wird danach zum neuen weiterleiten.\nDu kannst Weiterleitungen, die auf den Originaltitel verlinken, automatisch korrigieren lassen.\nStelle sicher, dass du im Anschluss alle [[Special:DoubleRedirects|doppelten]] oder [[Special:BrokenRedirects|kaputten Weiterleitungen]] überprüfst.\nDu bist dafür verantwortlich, dass Links weiterhin auf das korrekte Ziel verweisen.\n\nDie Seite wird \'\'\'nicht\'\'\' verschoben, sofern es bereits eine Seite mit dem vorgesehenen Titel gibt, es sei denn, diese ist leer oder eine Weiterleitung ohne Versionsgeschichte.\nDies bedeutet, dass du die Umbenennung rückgängig machen kannst, sofern du einen Fehler gemacht hast. Du kannst hingegen keine Seite überschreiben.\n\n\'\'\'Warnung!\'\'\'\nDie Verschiebung kann weitreichende und unerwartete Folgen für häufig besuchte Seiten haben.\nDu solltest daher die Konsequenzen verstanden haben, bevor du jetzt fortfährst.\";'),('de','messages:movepagetext-noredirectfixer','s:941:\"Mit untenstehendem Formular kannst du eine Seite umbenennen, indem du sie mitsamt allen Versionen auf einen neuen Titel verschiebst.\nDer alte Titel wird danach zum neuen weiterleiten.\nStelle sicher, dass du im Anschluss alle [[Special:DoubleRedirects|doppelten]] oder [[Special:BrokenRedirects|kaputten Weiterleitungen]] überprüfst.\nDu bist dafür verantwortlich, dass Links weiterhin auf das korrekte Ziel verweisen.\n\nDie Seite wird \'\'\'nicht\'\'\' verschoben, sofern es bereits eine Seite mit dem vorgesehenen Titel gibt, es sei denn, diese ist leer oder eine Weiterleitung ohne Versionsgeschichte.\nDies bedeutet, dass du die Umbenennung rückgängig machen kannst, sofern du einen Fehler gemacht hast. Du kannst hingegen keine Seite überschreiben.\n\n\'\'\'Warnung!\'\'\'\nDie Verschiebung kann weitreichende und unerwartete Folgen für häufig besuchte Seiten haben.\nDu solltest daher die Konsequenzen verstanden haben, bevor du jetzt fortfährst.\";'),('de','messages:movepagetalktext','s:418:\"Die dazugehörige Diskussionsseite wird, sofern vorhanden, mitverschoben, \'\'\'es sei denn:\'\'\'\n*Es existiert bereits eine Diskussionsseite mit diesem Namen, oder\n*du wählst die unten stehende Option ab.\n\nIn diesen Fällen musst du, falls gewünscht, den Inhalt der Seite von Hand verschieben oder zusammenführen.\n\nBitte den \'\'\'neuen\'\'\' Titel unter \'\'\'Ziel\'\'\' eintragen, darunter die Umbenennung bitte \'\'\'begründen.\'\'\'\";'),('de','messages:movearticle','s:18:\"Seite verschieben:\";'),('de','messages:moveuserpage-warning','s:172:\"\'\'\'Warnung:\'\'\' Du bist dabei, eine Benutzerseite zu verschieben. Bitte bedenke, dass dadurch nur die Benutzerseite verschoben, \'\'\'nicht\'\'\' aber der Benutzer umbenannt wird.\";'),('de','messages:movenologin','s:24:\"Du bist nicht angemeldet\";'),('de','messages:movenologintext','s:108:\"Du musst ein registrierter Benutzer und [[Special:UserLogin|angemeldet]] sein, um eine Seite zu verschieben.\";'),('de','messages:movenotallowed','s:79:\"Du hast nicht die erforderliche Berechtigung, um Seiten verschieben zu können.\";'),('de','messages:movenotallowedfile','s:80:\"Du hast nicht die erforderliche Berechtigung, um Dateien verschieben zu können.\";'),('de','messages:cant-move-user-page','s:89:\"Du hast nicht die erforderliche Berechtigung, Benutzerhauptseiten verschieben zu können.\";'),('de','messa