ges:confirmemail_send','s:28:\"Bestätigungscode zuschicken\";'),('de','messages:confirmemail_sent','s:38:\"Bestätigungs-E-Mail wurde verschickt.\";'),('de','messages:confirmemail_oncreate','s:198:\"Ein Bestätigungs-Code wurde an deine E-Mail-Adresse gesandt. Dieser Code wird für die Anmeldung nicht benötigt, jedoch wird er zur Aktivierung der E-Mail-Funktionen innerhalb des Wikis gebraucht.\";'),('de','messages:confirmemail_sendfailed','s:159:\"{{SITENAME}} konnte die Bestätigungs-E-Mail nicht an dich versenden.\nBitte prüfe die E-Mail-Adresse auf ungültige Zeichen.\n\nRückmeldung des Mailservers: $1\";'),('de','messages:confirmemail_invalid','s:138:\"Ungültiger Bestätigungscode. Möglicherweise ist der Bestätigungszeitraum verstrichen. Versuche bitte, die Bestätigung zu wiederholen.\";'),('de','messages:confirmemail_needlogin','s:57:\"Du musst dich $1, um deine E-Mail-Adresse zu bestätigen.\";'),('de','messages:confirmemail_success','s:103:\"Deine E-Mail-Adresse wurde erfolgreich bestätigt. Du kannst dich jetzt [[Special:UserLogin|anmelden]].\";'),('de','messages:confirmemail_loggedin','s:50:\"Deine E-Mail-Adresse wurde erfolgreich bestätigt.\";'),('de','messages:confirmemail_error','s:63:\"Es gab einen Fehler bei der Bestätigung deiner E-Mail-Adresse.\";'),('de','messages:confirmemail_subject','s:46:\"[{{SITENAME}}] Bestätigung der E-Mail-Adresse\";'),('de','messages:confirmemail_body','s:687:\"Hallo,\n\njemand mit der IP-Adresse $1, wahrscheinlich du selbst, hat das Benutzerkonto „$2“ in {{SITENAME}} registriert.\n\nUm die E-Mail-Funktion von {{SITENAME}} (wieder) zu aktivieren und um zu bestätigen,\ndass dieses Benutzerkonto wirklich zu deiner E-Mail-Adresse und damit zu dir gehört, öffne bitte die folgende Web-Adresse:\n\n$3\n\nSollte die vorstehende Adresse in deinem E-Mail-Programm über mehrere Zeilen gehen, musst du sie eventuell per Hand in die Adresszeile deines Web-Browsers einfügen.\n\nWenn du das genannte Benutzerkonto *nicht* registriert hast, folge diesem Link, um den Bestätigungsprozess abzubrechen:\n\n$5\n\nDieser Bestätigungscode ist gültig bis $6, $7 Uhr.\";'),('de','messages:confirmemail_body_changed','s:476:\"Jemand mit der IP-Adresse $1, wahrscheinlich du selbst,\nhat die E-Mail-Adresse des Benutzerkontos „$2“ zu dieser Adresse auf {{SITENAME}} geändert.\n\nUm zu bestätigen, dass dieses Benutzerkonto wirklich dir gehört\nund um die E-Mail-Features auf {{SITENAME}} zu reaktivieren, öffne diesen Link in deinem Browser:\n\n$3\n\nFalls das Konto *nicht* dir gehört, folge diesem Link,\num die E-Mail-Adress-Bestätigung abzubrechen:\n\n$5\n\nDieser Bestätigungscode ist gültig bis $4.\";'),('de','messages:confirmemail_body_set','s:535:\"Jemand mit der IP-Adresse $1, wahrscheinlich du selbst,\nhat die E-Mail-Adresse des Benutzerkontos „$2“ auf {{SITENAME}} zu dieser E-Mail-Adresse abgeändert.\n\nUm zu bestätigen, dass dieses Benutzerkonto wirklich zu dir gehört\nund um die E-Mail-Funktionen auf {{SITENAME}} wieder zu aktivieren, öffne bitte den folgenden Link in deinem Browser:\n\n$3\n\nFalls das Konto *nicht* zu dir gehört, bitte den nachfolgenden Link öffnen,\num die Bestätigung der E-Mail-Adresse abzubrechen:\n\n$5\n\nDieser Bestätigungscode ist gültig bis $4.\";'),('de','messages:confirmemail_invalidated','s:35:\"E-Mail-Adressbestätigung abbrechen\";'),('de','messages:invalidateemail','s:35:\"E-Mail-Adressbestätigung abbrechen\";'),('de','messages:scarytranscludedisabled','s:38:\"[Interwiki-Einbindung ist deaktiviert]\";'),('de','messages:scarytranscludefailed','s:44:\"[Vorlageneinbindung für $1 ist gescheitert]\";'),('de','messages:scarytranscludetoolong','s:17:\"[URL ist zu lang]\";'),('de','messages:trackbackbox','s:37:\"Trackbacks für diese Seite:<br />\n$1\";'),('de','messages:trackbackremove','s:15:\"([$1 löschen])\";'),('de','messages:trackbacklink','s:9:\"Trackback\";'),('de','messages:trackbackdeleteok','s:38:\"Trackback wurde erfolgreich gelöscht.\";'),('de','messages:deletedwhileediting','s:261:\"Achtung: Diese Seite wurde gelöscht, nachdem du angefangen hast sie zu bearbeiten!\nIm [{{fullurl:{{#special:Log}}|type=delete&page={{FULLPAGENAMEE}}}} Lösch-Logbuch] findest du den Grund für die Löschung. Wenn du die Seite speicherst, wird sie neu angelegt.\";'),('de','messages:confirmrecreate','s:231:\"Benutzer [[User:$1|$1]] ([[User talk:$1|Diskussion]]) hat diese Seite gelöscht, nachdem du angefangen hast, sie zu bearbeiten. Die Begründung lautete:\n:\'\'$2\'\'\nBitte bestätige, dass du diese Seite wirklich neu erstellen möchten.\";'),('de','messages:confirmrecreate-noreason','s:200:\"Benutzer [[User:$1|$1 ]] ([[User talk:$1|Diskussion]]) hat diese Seite gelöscht, nachdem du mit der Bearbeitung begonnen hast. Bitte bestätige, dass du die Seite wirklich erneut erstellen möchtest.\";'),('de','messages:recreate','s:14:\"Erneut anlegen\";'),('de','messages:confirm_purge_button','s:2:\"OK\";'),('de','messages:confirm-purge-top','s:42:\"Diese Seite aus dem Server-Cache löschen?\";'),('de','messages:confirm-purge-bottom','s:75:\"Leert den Cache einer Seite und erzwingt die Anzeige der aktuellen Version.\";'),('de','messages:confirm-watch-button','s:2:\"OK\";'),('de','messages:confirm-watch-top','s:60:\"Diese Seite zur persönlichen Beobachtungsliste hinzufügen?\";'),('de','messages:confirm-unwatch-button','s:2:\"OK\";'),('de','messages:confirm-unwatch-top','s:62:\"Diese Seite von der persönlichen Beobachtungsliste entfernen?\";'),('de','messages:ellipsis','s:3:\"…\";'),('de','messages:percent','s:9:\"$1&nbsp;%\";'),('de','messages:imgmultipageprev','s:19:\"← vorherige Seite\";'),('de','messages:imgmultipagenext','s:18:\"nächste Seite →\";'),('de','messages:imgmultigo','s:2:\"OK\";'),('de','messages:imgmultigoto','s:16:\"Gehe zu Seite $1\";'),('de','messages:ascending_abbrev','s:3:\"auf\";'),('de','messages:descending_abbrev','s:2:\"ab\";'),('de','messages:table_pager_next','s:14:\"Nächste Seite\";'),('de','messages:table_pager_prev','s:15:\"Vorherige Seite\";'),('de','mess