INSERT INTO `text` VALUES (1,'\'\'\'MediaWiki wurde erfolgreich installiert.\'\'\'\n\nHilfe zur Benutzung und Konfiguration der Wiki-Software findest du im [//meta.wikimedia.org/wiki/Help:Contents Benutzerhandbuch].\n\n== Starthilfen ==\n\n* [//www.mediawiki.org/wiki/Manual:Configuration_settings Liste der Konfigurationsvariablen]\n* [//www.mediawiki.org/wiki/Manual:FAQ MediaWiki-FAQ]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce Mailingliste neuer MediaWiki-Versionen]','utf-8'),(2,'Dies ist ein Attribut des Datentyps [[Datentyp::Zeichenkette]].','utf-8'),(3,'Dies ist ein Attribut des Datentyps [[Datentyp::Zahl]].','utf-8'),(4,'Dies ist ein Attribut des Datentyps [[Datentyp::URL]].','utf-8'),(5,'Dies ist ein Attribut des Datentyps [[Datentyp::Zeichenkette]].','utf-8'),(6,'Dies ist ein Attribut des Datentyps [[Datentyp::Zahl]].','utf-8'),(7,'<noinclude>\nDies ist die Vorlage „Article“.\nSie sollte im folgenden Format aufgerufen werden:\n<pre>\n{{Article\n|ArticleTitle=\n|ArticlePage=\n|PublicationTitle=\n|PublicationIssue=\n}}\n</pre>\nKlicke auf „Bearbeiten“, um den Vorlagentext anzusehen.\n</noinclude><includeonly>{| class=\"wikitable\"\n! Titel\n| [[ArticleTitle::{{{ArticleTitle|}}}]]\n|-\n! Page\n| [[ArticlePage::{{{ArticlePage|}}}]]\n|-\n! Publication\n| [[PublicationTitle::{{{PublicationTitle|}}}]]\n|-\n! Issue\n| [[PublicationIssue::{{{PublicationIssue|}}}]]\n|}\n\n[[Kategorie:Article]]\n</includeonly>','utf-8'),(8,'<noinclude>\nDies ist das Formular „Article“.\nUm eine Seite mit diesem Formular zu erstellen, gib den Seitennamen unten in das Eingabefeld ein. \nSofern bereits eine Seite mit diesem Namen vorhanden ist, wirst du automatisch zum Formular für das Bearbeiten der Seite weitergeleitet.\n\n\n{{#forminput:form=Article}}\n\n</noinclude><includeonly>\n<div id=\"wikiPreview\" style=\"display: none; padding-bottom: 25px; margin-bottom: 25px; border-bottom: 1px solid #AAAAAA;\"></div>\n{{{for template|Article}}}\n{| class=\"formtable\"\n! ArticleTitle:\n| {{{field|ArticleTitle|mandatory|property=ArticleTitle}}}\n|-\n! ArticlePage:\n| {{{field|ArticlePage|mandatory|property=ArticlePage}}}\n|-\n! PublicationTitle:\n| {{{field|PublicationTitle|input type=text with autocomplete|mandatory|property=PublicationTitle|values from property=PublicationTitle}}}\n|-\n! PublicationIssue:\n| {{{field|PublicationIssue|mandatory|property=PublicationIssue}}}\n|}\n{{{end template}}}\n\n\'\'\'Freitext:\'\'\'\n\n{{{standard input|free text|rows=10}}}\n\n\n{{{standard input|summary}}}\n\n{{{standard input|minor edit}}} {{{standard input|watch}}}\n\n{{{standard input|save}}} {{{standard input|preview}}} {{{standard input|changes}}} {{{standard input|cancel}}}\n</includeonly>','utf-8'),(9,'Dies ist ein Attribut des Datentyps [[Datentyp::Zeichenkette]].','utf-8'),(10,'<noinclude>\nDies ist die Vorlage „Publication“.\nSie sollte im folgenden Format aufgerufen werden:\n<pre>\n{{Publication\n|PublicationTitle=\n|Publisher=\n}}\n</pre>\nKlicke auf „Bearbeiten“, um den Vorlagentext anzusehen.\n</noinclude><includeonly>{| class=\"wikitable\"\n! Titel\n| [[PublicationTitle::{{{PublicationTitle|}}}]]\n|-\n! Publisher\n| [[Publisher::{{{Publisher|}}}]]\n|}\n\n[[Kategorie:Publication]]\n</includeonly>','utf-8'),(11,'<noinclude>\nDies ist die Vorlage „Publisher“.\nSie sollte im folgenden Format aufgerufen werden:\n<pre>\n{{Publisher\n|Publisher=\n}}\n</pre>\nKlicke auf „Bearbeiten“, um den Vorlagentext anzusehen.\n</noinclude><includeonly>{| class=\"wikitable\"\n! Publisher\n| [[Publisher::{{{Publisher|}}}]]\n|}\n\n[[Kategorie:Publisher]]\n</includeonly>','utf-8'),(12,'<noinclude>\nDies ist das Formular „Publication“.\nUm eine Seite mit diesem Formular zu erstellen, gib den Seitennamen unten in das Eingabefeld ein. \nSofern bereits eine Seite mit diesem Namen vorhanden ist, wirst du automatisch zum Formular für das Bearbeiten der Seite weitergeleitet.\n\n\n{{#forminput:form=Publication}}\n\n</noinclude><includeonly>\n<div id=\"wikiPreview\" style=\"display: none; padding-bottom: 25px; margin-bottom: 25px; border-bottom: 1px solid #AAAAAA;\"></div>\n{{{for template|Publication}}}\n{| class=\"formtable\"\n! PublicationTitle:\n| {{{field|PublicationTitle|mandatory|property=PublicationTitle}}}\n|-\n! Publisher:\n| {{{field|Publisher|input type=text with autocomplete|mandatory|property=Publisher|values from property=Publisher}}}\n|}\n{{{end template}}}\n\n\'\'\'Freitext:\'\'\'\n\n{{{standard input|free text|rows=10}}}\n\n\n{{{standard input|summary}}}\n\n{{{standard input|minor edit}}} {{{standard input|watch}}}\n\n{{{standard input|save}}} {{{standard input|preview}}} {{{standard input|changes}}} {{{standard input|cancel}}}\n</includeonly>','utf-8'),(13,'<noinclude>\nDies ist das Formular „Publisher“.\nUm eine Seite mit diesem Formular zu erstellen, gib den Seitennamen unten in das Eingabefeld ein. \nSofern bereits eine Seite mit diesem Namen vorhanden ist, wirst du automatisch zum Formular für das Bearbeiten der Seite weitergeleitet.\n\n\n{{#forminput:form=Publisher}}\n\n</noinclude><includeonly>\n<div id=\"wikiPreview\" style=\"display: none; padding-bottom: 25px; margin-bottom: 25px; border-bottom: 1px solid #AAAAAA;\"></div>\n{{{for template|Publisher|label=Publisher}}}\n{| class=\"formtable\"\n! Publisher:\n| {{{field|Publisher|mandatory|property=Publisher}}}\n|}\n{{{end template}}}\n\n\'\'\'Freitext:\'\'\'\n\n{{{standard input|free text|rows=10}}}\n\n\n{{{standard input|summary}}}\n\n{{{standard input|minor edit}}} {{{standard input|watch}}}\n\n{{{standard input|save}}} {{{standard input|preview}}} {{{standard input|changes}}} {{{standard input|cancel}}}\n</includeonly>','utf-8'),(14,'{{Publisher\n|Publisher=Berliner Morgenpost\n}}','utf-8'),(15,'{{Publication\n|PublicationTitle=Die Zeit\n|Publisher=Berliner Morgenpost\n}}','utf-8'),(16,'\'\'\'MediaWiki wurde erfolgreich installiert.\'\'\'\n\nHilfe zur Benutzung und Konfiguration der Wiki-Software findest du im [//meta.wikimedia.org/wiki/Hel