blicationIssue::{{{PublicationIssue|}}}]]\n|}\n\n[[Kategorie:Artikel]]\n[[en:{{PAGENAME}}]]\n\n[[Page has default form::Article]]\n\n</includeonly>','utf-8'),(57,'= Willkommen =\n\nHerzlich willkommen bei Wikijournals. Ziel dieses Wiki ist es, eine zentrale Stelle für die Suche nach Zeitungs- und Zeitschriftenartikeln sowie sonstigen Publikationen zu schaffen.\n\nÜber die Suchfunktion auf der linken Seite können Artikel nach folgenden Kriterien gesucht werden:\n\n* Autor\n* Publikation\n* Verlag\n\nWer mehr über mich erfahren möchte, kann gern mein Blog unter http://krumrueck.de besuchen.\n\n== Mitmachen erwünscht ==\n\nDieses Wiki lebt vom aktiven Mitmachen. Jeder kann selbst Artikel eintragen. Dazu muss man sich lediglich über den Link \"Anmelden / Benutzerkonto erstellen\" registrieren, der sich rechts oben befindet. Neue Artikel können dann über den Eintrag \"Neu\" aus der linken Navigationsleiste erstellt werden.\n\nDieses Wiki steht noch am Anfang, es ist daher noch nicht alles perfekt. Wer Anregungen und Wünsche hat, oder Fehler findet, kann diese auf der Facebookseite von Wikijournals eintragen. Dort findet ihr auch Berichte über Neuentwicklungen und sonstige Diskussionsanregungen :o)\n\n= Aktuelle Artikel =\n\n{{#ask:[[Kategorie:Artikel]] \n|?ArticleSubtitle=Untertitel\n|?ArticleRubric=Rubrik\n|?JournalTitle=Journal\n|?ArticleTitle=Titel\n|?ArticleIssue=Ausgabe\n|?ArticleYear=Jahr\n|?Page=Page\n|mainlabel=Artikel\n|format=template\n|template=QueryTable\n|introtemplate=QueryTableHeader\n|outrotemplate=QueryTableFooter\n|sort=EntryDate\n|order=desc\n|limit=20\n}}\n\n<headertabs/>','utf-8'),(58,'Wikijournals','utf-8'),(59,'\n* navigation\n** mainpage|mainpage-description\n** recentchanges-url|recentchanges\n** helppage|help\n* Neu\n** Spezial:FormEdit/Article|Artikel\n** Spezial:FormEdit/Publication|Publikation\n** Spezial:FormEdit/Publisher|Verlag\n** Spezial:FormEdit/Author|Autor\n* SEARCH\n* TOOLBOX\n* LANGUAGES','utf-8'),(60,'<noinclude>\nDies ist das Form